import React, { Component } from "react";
import Dropdown from "./dropdown bar/dropdown";
import usdrate from "../usdRates";

class latestRate extends Component {
  state = {};
  render() {
    return (
      <div>
        <Dropdown />
        <usdrate />
      </div>
    );
  }
}

export default latestRate;
